import React from "react";
import "../../App.css";
import CardItem from "../CardItem";

export default function Products() {
  const x = [1, 2, 3, 4, 5, 6, 7, 8, 9.1];
  return (
    <>
      <ul className="d-flex">
        {x.forEach((ele) => {
          console.log()
          return (
            <CardItem src="https://images.pexels.com/photos/372882/pexels-photo-372882.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
          );
        })}
      </ul>
    </>
  );
}
